  18,\n\t\"tags\": [],\n\t\"title\": \"Dissolved inorganic carbon, alkalinity, temperature,
  salinity and other variables collected from discrete sample and profile observations
  using CTD, bottle and other instruments from the METEOR in the North Atlantic Ocean
  from 2004-03-11 to 2004-04-13 (NODC Accession 0113892)\",\n\t\"tracking_summary\":
