  [],\n\t\"revision_timestamp\": \"2015-09-27T01:12:46.304509\",\n\t\"name\": \"dissolved-inorganic-carbon-alkalinity-temperature-salinity-and-other-variables-collected-from-d10de7\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113892 includes chemical,
  discrete sample, physical and profile data collected from METEOR in the North Atlantic
  Ocean from 2004-03-11 to 2004-04-13 and retrieved during cruise CARINA/06MT20040311.
  These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12
  (CFC-12), Carbon tetrachloride (CCL4), DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN,
  HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta),
  SALINITY, SILICATE, SULFUR HEXAFLUORIDE (SF6) and WATER TEMPERATURE. The instruments
  used to collect these data include CTD and bottle. These data were collected by
  Douglas Wallace of Universitat Kiel; Institut Fur Meereskunde; Forschungsbereich
  Marine Biogeochemie as part of the CARINA/06MT20040311 data set.nnThe CARINA (CARbon
  dioxide IN the Atlantic Ocean) data synthesis project is an international collaborative
  effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced a merged internally
  consistent data set of open ocean subsurface measurements for biogeochemical investigations,
  in particular, studies involving the carbon system. The original focus area was
  the North Atlantic Ocean, but over time the geographic extent expanded and CARINA
  now includes data from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"license_title\":
